import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
        <nav>
            <ul style={styles.navList}>
                <li>
                    <NavLink to="/categories" style={styles.navLink} activeStyle={styles.activeLink}>Categories</NavLink>
                </li>
                <li>
                    <NavLink to="/models" style={styles.navLink} activeStyle={styles.activeLink}>Models</NavLink>
                </li>
                <li>
                    <NavLink to="/board-parts" style={styles.navLink} activeStyle={styles.activeLink}>Board Parts</NavLink>
                </li>
                <li>
                    <NavLink to="/components" style={styles.navLink} activeStyle={styles.activeLink}>Components</NavLink>
                </li>
                <li>
                    <NavLink to="/board-part-components" style={styles.navLink} activeStyle={styles.activeLink}>Board Part Components</NavLink>
                </li>
            </ul>
        </nav>
    );
};

const styles = {
    navList: {
        listStyle: 'none',
        padding: 0,
    },
    navLink: {
        color: 'white',
        textDecoration: 'none',
        display: 'block',
        padding: '10px 0',
    },
    activeLink: {
        fontWeight: 'bold',
        backgroundColor: '#444',
    },
};

export default Navigation;
